    <style>
        *,
        *:before,
        *:after {
            padding: 0;
            margin: 0;
            box-sizing: border-box;

        }

        body {
            background-color: #080710;
        }

        .background {
            width: 430px;
            height: 625px;
            position: absolute;
            transform: translate(-50%, -50%);
            left: 50%;
            top: 50%;
        }


        .background .shape {
            height: 200px;
            width: 200px;
            position: absolute;
            border-radius: 50%;

        }

        .shape:first-child {
            background: linear-gradient(#1845ad,
                    #23a2f6);
            left: -102px;
            top: -102px;
            animation-name: first;
            animation-duration: 3s;
        }

        @keyframes first {
            0% {
                top: 150px;
                left: 0px;
            }

            20% {
                top: 0px;
            }
        }

        .shape:last-child {
            background: linear-gradient(to right,
                    #ff512f,
                    #f09819);
            right: -85px;
            bottom: -94px;
            animation-name: last;
            animation-duration: 3s;
        }

        @keyframes last {
            0% {
                bottom: 150px;
                right: 0px;
            }

            20% {
                bottom: 0px;
            }
        }

        form {
            height: auto;
            width: 420px;
            background-color: rgba(255, 255, 255, 0.13);
            position: absolute;
            transform: translate(-50%, -50%);
            top: 50%;
            left: 50%;
            border-radius: 10px;
            backdrop-filter: blur(10px);
            border: 2px solid rgba(255, 255, 255, 0.1);
            box-shadow: 0 0 40px rgba(8, 7, 16, 0.6);
            padding: 50px 35px;

        }

        form * {
            font-family: 'Poppins', sans-serif;
            color: #ffffff;
            letter-spacing: 0.5px;
            outline: none;
            border: none;
        }

        form h3 {
            font-size: 32px;
            font-weight: 500;
            line-height: 42px;
            text-align: center;
        }

        label {
            display: block;
            margin-top: 30px;
            font-size: 16px;
            font-weight: 500;
        }

        input {
            height: 50px;
            width: 100%;
            background-color: rgba(255, 255, 255, 0.07);
            border-radius: 3px;
            padding: 0 10px;
            margin-top: 8px;
            font-size: 12px;
            font-weight: 300;

        }

        #redio {
            font-size: 10px;
        }

        ::placeholder {
            color: #e5e5e5;
        }

        button {
            margin-top: 50px;
            width: 100%;
            background-color: #ffffff;
            color: #080710;
            padding: 15px 0;
            font-size: 18px;
            font-weight: 600;
            border-radius: 5px;
            cursor: pointer;
        }

        .whatsapp-number,
        .name {
            display: flex;
            align-items: center;
        }

        .whatsapp-number select {
            height: 50px;
            width: 30%;
            background-color: rgba(255, 255, 255, 0.07);
            border-radius: 3px;
            padding: 0 10px;
            margin-top: 8px;
            font-size: 12px;
            font-weight: 300;
        }

        .whatsapp-number input {
            height: 50px;
            width: 70%;
            background-color: rgba(255, 255, 255, 0.07);
            border-radius: 3px;
            padding: 0 10px;
            margin-top: 8px;
            font-size: 12px;
            font-weight: 300;
        }

        .whatsapp-number select,
        .whatsapp-number input {
            margin-right: 10px;
        }

        .whatsapp-number option {
            color: #080710;
            /* Change font color of options to your desired color */
        }
    </style>

</head>
